import React from "react";
import "../components/body.scss";

export default function Body() {
  return (
    <div className = "body">
      <h3 className = "name"> Min Goo Jo </h3> 
      <h4> Junior Full Stack Developer </h4>
      <img className = "body--profileImage" src = "../../images/mgj.jpeg" alt = "MGJ"/> 
      <img src="../logo192.png" />
    </div>
  )

}
